import React from "react";

const PrevReport = ({ item }) => {
  return (
    <div className="card">
      <p>Location - <img src = {item.thumbnailUrl}/>
        IR - {item.id}  
        Name - {item.title} 
        </p>
    </div>
  );
};

export default PrevReport;
